import React from 'react';
import TopNavbar from './components/TopNavbar';
import BottomNavbar from './components/BottomNavbar';
import Footer from './components/Footer';
import Grid from '@material-ui/core/Grid';
import Introduction from './components/Introduction';
import SignUpForm from './components/SignUpForm';

const Landing = () => {
	return (
		<Grid container direction='column' justify='space-between' alignItems='center' className='container'>
			<Grid item container>
				<Grid item container>
					<TopNavbar />
				</Grid>
				<Grid item container>
					<BottomNavbar />
				</Grid>
			</Grid>
			<Grid
				item
				xs={2}
				ls={7}
				container
				direction='row-reverse'
				justify='center'
				alignItems='center'
				spacing={7}
				className='border'
			>
				<Grid item className='rtl'>
					<Introduction />
				</Grid>
				<Grid item>
					<SignUpForm />
				</Grid>
			</Grid>
			<Grid item>
				<Footer />
			</Grid>
		</Grid>
	);
};

export default Landing;
